import React, { useState } from 'react';
import '../../styles/Onboard.css';
import logo from '../../dashboard_image/logo.png'; // Adjust path if needed

const Onboard = (props) => {
    const [step, setStep] = useState(1);
    
    // Input state for Step 1
    const [firstName, setFirstName] = useState('');
    const [username, setUsername] = useState('');
    const [error, setError] = useState('');

    // Handler for "Following" button
    const nextStep = () => {
        // Check if the fields are filled before moving to the next step
        if (step === 1 && (!firstName || !username)) {
            setError('Please fill out all fields');
            return;
        }
        setError(''); // Clear error if everything is correct
        if (step < 5) {
            setStep(step + 1);
        }
    };

    // Handler for "Back" button
    const prevStep = () => {
        if (step > 1) {
            setStep(step - 1);
        }
    };

    const renderContent = () => {
        switch (step) {
            case 1:
                return (
                    <div className="popup">
                        <h2>What is your name?</h2>
                        <p>Tell us your name to personalize your experience.</p>
                        <input
                            type="text"
                            placeholder="Firstname"
                            value={firstName}
                            onChange={(e) => setFirstName(e.target.value)}
                        />
                        <input
                            type="text"
                            placeholder="Username"
                            value={username}
                            onChange={(e) => setUsername(e.target.value)}
                        />
                        {error && <p className="error">{error}</p>}
                        <button onClick={nextStep}>Following</button>
                    </div>
                );
            case 2:
                return (
                    <div className="popup">
                        <h2>What is your goal?</h2>
                        <input type="radio" name="goal" value="Gain weight" /> Gain weight
                        <input type="radio" name="goal" value="Lose weight" /> Lose weight
                        <div className="button-group">
                            <button onClick={prevStep}>Back</button>
                            <button onClick={nextStep}>Following</button>
                        </div>
                    </div>
                );
            case 3:
                return (
                    <div className="popup">
                        <h2>What is your activity level?</h2>
                        <input type="radio" name="activity" value="Low" /> Low
                        <input type="radio" name="activity" value="Medium" /> Medium
                        <input type="radio" name="activity" value="High" /> High
                        <div className="button-group">
                            <button onClick={prevStep}>Back</button>
                            <button onClick={nextStep}>Following</button>
                        </div>
                    </div>
                );
            case 4:
                return (
                    <div className="popup">
                        <h2>Complete your info</h2>
                        <input type="text" placeholder="Age" />
                        <input type="text" placeholder="Height" />
                        <input type="text" placeholder="Weight" />
                        <div className="button-group">
                            <button onClick={prevStep}>Back</button>
                            <button onClick={nextStep}>Following</button>
                        </div>
                    </div>
                );
            case 5:
                return (
                    <div className="popup">
                        <h2>Congratulations!</h2>
                        <p>You have completed the onboarding process.</p>
                        <button onClick={props.onComplete}>Go to Dashboard</button>
                    </div>
                );
            default:
                return null;
        }
    };

    return (
        <div className="onboard-container">
            {/* Fixed Header with Logo */}
            <div className="header-logo">
                <img src={logo} alt="Nutritioners Logo" />
                <h1 className="logo-title">Nutritioners</h1>
            </div>

            <div className="background"></div>
            {renderContent()}
        </div>
    );
};

export default Onboard;
